def custom_sort_string(order, string):
    count = {}
    for char in string:
        count[char] = count.get(char, 0) + 1
    result = ''
    for char in order:
        if char in count:
            result += char * count[char]
            del count[char]
    for char, freq in count.items():
        result += char * freq
    return result
